import React from 'react';

export default function Date(props) {
    let now = new Date ();
    let days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday"
    ];
    let day = days[props.now.getDay()];
    return (
      <div>
        {day}
      </div>
    );
}
